- input: "TEXT\x1CC00236778\x1C615542\x1C\x1CF3XA\x1CFiling amendment.  Received letter
    from FEC on 12-11-09 (RQ-2) regarding information contained in 'employer name'
    and 'occupation' fields. The letter indicated that 'self-employed' and 'owner-operator'
    were not sufficient responses. Angel Burnell called and spoke with analyst Alexandra
    Broomhead and explained that OOIDA is a trade association that represents small
    business truck drivers. The members that contribute to the OOIDA PAC are self-employed
    truckers that owner and operate their own trucks. Ms. Broomhead asked Angel Burnell
    to amend the report and include that information, as explained to her, in the
    memo.  Thus, the amended filing.  Also, in amending the report we noticed a batch
    of receipts from June and July 2009 that failed to upload into the previously
    filed reports (mid-year and pre-special).  That problem has been corrected and
    the amended reports reflect the correct receipt totals.  The disbursement totals
    did not change.\n"
